import '../styles/components/Navbar.scss';

const Navbar = ({title}) =>{

    return(
        <>
        <h1>{title}</h1>
        <ul>
            <li>Home</li>
            <li>About</li>
            <li>Menu</li>
            <li>Privacy</li>
        </ul>
        </>
    )
};
export default Navbar;
